    const Navigate = useNavigate()
    const My = () =>{
        Navigate('/')
    }
    return <div>
        Hometown introduction
        <img src={logo} alt="logo"/> 
        <button onClick={My}>my introduction</button>
        <GetWeather/>
        </div>
}
export default HtIntro;
